INSERT INTO `os_germplasm` VALUES (10, '白荷芋2', '无', NULL, '引进', '24', '159', '0', NULL, NULL, NULL, NULL, '2021', '种实', '江苏省种质资源基因库', '低温保存', '来源于江苏泰兴，地方种，属多子芋，出苗率较高，绿色卵圆形叶片，叶脉绿色，假茎粗2.8cm，椭圆形芋，整齐度中等，商品率中等，疫病很少发生，斜纹夜蛾发生轻。', '有待今后进一步鉴定确定其利用价值。', NULL, NULL, 1, 0, '蔡志林', 92, '2021-05-17 15:39:11');
INSERT INTO `os_germplasm` VALUES (11, '槟榔芋2', '无', NULL, '引进', '24', '159', '0', NULL, NULL, NULL, NULL, '2021', '种实', '江苏省种质资源基因库', '低温保存', '来源于福建，属魁芋，出苗率较高，深绿色卵圆形叶片，叶脉绿带紫色，假茎粗2.3cm，椭圆形芋，整齐度中等，商品率低，疫病发生中等，斜纹夜蛾发生中等。', '有待今后进一步鉴定确定其利用价值。', NULL, NULL, 1, 0, '蔡志林', 92, '2021-05-17 15:39:11');
